import React, { useState } from "react";
import { Formik, Form, Field, ErrorMessage } from "formik";
import * as Yup from "yup";
import clsx from "clsx";
import { makeStyles } from "@material-ui/core/styles";
import IconButton from "@material-ui/core/IconButton";
import Input from "@material-ui/core/Input";
import InputLabel from "@material-ui/core/InputLabel";
import InputAdornment from "@material-ui/core/InputAdornment";
import FormControl from "@material-ui/core/FormControl";
import Visibility from "@material-ui/icons/Visibility";
import VisibilityOff from "@material-ui/icons/VisibilityOff";

const useStyles = makeStyles((theme) => ({
  root: {
    display: "flex",
    flexWrap: "wrap",
  },
  margin: {
    margin: theme.spacing(1),
  },
  withoutLabel: {
    marginTop: theme.spacing(3),
  },
  textField: {
    width: "25ch",
  },
}));

function SignUpFormCompanyy() {
  const initialValues = {
    name: "",
    email: "",
    city: "",
    password: "",
    confirmPassword: "",
  };
  const classes = useStyles();
  const [showPassword, setShowPassword] = useState(false);

  const handleMouseDownPassword = (event) => {
    event.preventDefault();
  };
  function handleSubmit(values) {
    console.log(values);
  }
  const sigUpSchema = Yup.object().shape({
    name: Yup.string()
      .min(2, "Company name is too short")
      .required("Company name is required"),
    city: Yup.string().required("Please select a city"),
    password: Yup.password().required("Password is required"),
  });
  return (
    <div>
      <h1>Sign Up</h1>
      <Formik
        initialValues={initialValues}
        onSubmit={handleSubmit}
        validationSchema={sigUpSchema}
      >
        {({ dirty, isValid }) => {
          return (
            <Form>
              <div>
                <Field
                  name="name"
                  as="input"
                  placeholder="Company Name"
                ></Field>
                <ErrorMessage name="name" />
              </div>

              <div>
                <Field name="city" as="select" placeholder="City">
                  <option value="empty">Select</option>
                  <option value="ist">İst</option>
                </Field>
                <ErrorMessage name="name" />
              </div>

              <button disabled={!dirty || !isValid} type="submit">
                Submit
              </button>
            </Form>
          );
        }}
      </Formik>
    </div>
  );
}

export default SignUpFormCompanyy;
